import React
// , { useEffect, useState } 
from 'react'
// import { useNavigate } from 'react-router-dom';
// import { handleError, handleSuccess } from '../utils';
// import { ToastContainer } from 'react-toastify';

// import React from "react";
// import "../public/Styles_format/style.css";
import styles from "../styles/styles.css";


const Home = () => {
  return (
    <div>
      {/* Top Bar */}
      <div id="topbar" className="d-flex align-items-center fixed-top">
        <div className="container d-flex justify-content-between">
          <div className="contact-info d-flex align-items-center">
            <i className="bi bi-envelope"></i>
            <a href="mailto:contact@example.com">medicore@marquette.edu</a>
            <i className="bi bi-phone"></i> +1 4143495697
          </div>
          <div className="d-none d-lg-flex social-links align-items-center">
            <a href="#" className="twitter"><i className="bi bi-twitter"></i></a>
            <a href="#" className="facebook"><i className="bi bi-facebook"></i></a>
            <a href="#" className="instagram"><i className="bi bi-instagram"></i></a>
            <a href="#" className="linkedin"><i className="bi bi-linkedin"></i></a>
          </div>
        </div>
      </div>

      {/* Header */}
      <header id="header" className="fixed-top">
        <div className="container d-flex align-items-center">
          <h1 className="logo me-auto">
            <a href="/">MediCore</a>
          </h1>
          <nav id="navbar" className="navbar order-last order-lg-0">
            <ul>
              <li><a className="nav-link scrollto active" href="#hero">Home</a></li>
              <li><a className="nav-link scrollto" href="#about">About</a></li>
              <li><a className="nav-link scrollto" href="#services">Services</a></li>
              <li><a className="nav-link scrollto" href="#gallery">Gallery</a></li>
              <li><a className="nav-link scrollto" href="#contact">Contact</a></li>
            </ul>
            <i className="bi bi-list mobile-nav-toggle"></i>
          </nav>
          <button type="button" className="appointment-btn scrollto" id="make-appointment-button">
            Make an Appointment
          </button>
        </div>
      </header>

      {/* Hero Section */}
      <section id="hero" className="d-flex align-items-center">
        <div className="container">
          <h1>Welcome to MediCore</h1>
          <h2>Your health is our priority</h2>
        </div>
      </section>

      {/* About Section */}
      <section id="about" className="about">
        <div className="container">
          <h2>About MediCore</h2>
          <p>
            At MediCore, we are committed to providing patient-centered, comprehensive healthcare services.
          </p>
        </div>
      </section>

      {/* Footer */}
      <footer id="footer">
        <div className="footer-top">
          <div className="container">
            <h3>MediCore</h3>
            <p>Cudahy Hall, 1313 W Wisconsin Ave, Milwaukee, WI</p>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default Home;
